'require base';

/**
 * Synonym for Object.prototype.hasOwnProperty.call(obj, prop).
 * @param {!Object} obj
 * @param {string} prop
 * @return {boolean}
 */
$jscomp.owns = function(obj, prop) {
  return Object.prototype.hasOwnProperty.call(obj, prop);
};

